const Results = ({ data, error }) => {
  /*
  {
    'movie_title': movie_title,
    'year': year,
    'runtime': runtime,
    'age_rating': age_rating,
    #'genres': genres
    {data.map((d) => {
      <p>
        {d.movie_title} | {d.year} | {d.runtime} | {d.age_rating}
      </p>;
    })}
  }
  */

  return (
    <div>
      <h1 className="heading">Results</h1>
      <div className="results-list-container"></div>
    </div>
  );
};

export default Results;
